			targetcntrl[2].getItems()[0].getItems()[1].getItems()[0].setValue(rsltValue.City);
		//	targetcntrl[2].getItems()[0].getItems()[1].getItems()[0].setValue(rsltValue.RegDesc);
			//targetcntrl[5].getItems()[1].getItems()[0].setSelectedKey(rsltValue.COUNTRY_NAME);
		//	targetcntrl[2].getItems()[1].getItems()[1].getItems()[0].setValue(rsltValue.CountryName);
			targetcntrl[2].getItems()[3].getItems()[1].getItems()[0].setValue(rsltValue.PostCode);
			targetcntrl[0].getItems()[0].getItems()[1].getItems()[0].setValue(rsltValue.CareOf);
			targetcntrl[4].getItems()[0].getItems()[1].getItems()[0].setValue(rsltValue.ShipAccNo);
			//targetcntrl[4].getItems()[1].getItems()[1].getItems()[0].setValue(rsltValue.Carrier);
			
