		 doAddShippingInformation:function(that) {
			var csrf;
			var filterStr = "Aufnr eq '"+globalWANo+"'";
			var oDataModel=this.loadOdata();
			oDataModel.read('ZShipment_UpdateSet', null, {
				"$format" : "json",
				"$filter" : filterStr
			}, false, function(oData, oResponse) {
				csrf = oResponse.headers["x-csrf-token"];
				 
			}, function(oError) { //
				console.log("error");
			});
			
			
			
			var oDataModel = new sap.ui.model.odata.ODataModel("/sap/opu/odata/sap/Z_ESP_GW_SERVICE_SRV");
			oDataModel.setHeaders({
				"x-csrf-token" : csrf
			});
			
			var shippingCarousel = sap.ui.getCore().byId("shippingInforCarousel");
			var carouselPageLength=shippingCarousel.getPages().length;
			var batchChanges = [];
			var oPrimary = {};
			var oEndpoint = {}; 
			var oEntry;
			var cnt = 0;
			var endcnt = 0;
			var othersCount = 0;
			//var pageId=sap.ui.getCore().byId("idPage1");
			for(var i=0;i<carouselPageLength;i++){
				
				oEntry = {};
				var targetcntrl=shippingCarousel.getPages()[i].getContent()[0].getItems();
				
				var pgID=shippingCarousel.getPages()[i].getId();
				
				oEntry.Adressline1 = targetcntrl[0].getItems()[1].getItems()[1].getItems()[0].getValue();//targetcntrl[0].getItems()[1].getItems()[0].getValue();
				oEntry.Adressline2 = targetcntrl[0].getItems()[2].getItems()[1].getItems()[0].getValue();//targetcntrl[1].getItems()[1].getItems()[0].getValue();
				oEntry.Adressline3 = targetcntrl[0].getItems()[3].getItems()[1].getItems()[0].getValue();//targetcntrl[2].getItems()[1].getItems()[0].getValue();
				
				oEntry.City 		= targetcntrl[2].getItems()[0].getItems()[1].getItems()[0].getValue();//targetcntrl[3].getItems()[1].getItems()[0].getValue();
				oEntry.Country 		= targetcntrl[2].getItems()[1].getItems()[1].getItems()[0].getSelectedKey();
				oEntry.Region 		= targetcntrl[2].getItems()[2].getItems()[1].getItems()[0].getSelectedKey();
				
				oEntry.PostCode 	= targetcntrl[2].getItems()[3].getItems()[1].getItems()[0].getValue();//targetcntrl[6].getItems()[1].getItems()[0].getValue();;
				oEntry.CareOf 		= targetcntrl[0].getItems()[0].getItems()[1].getItems()[0].getValue();;//targetcntrl[7].getItems()[1].getItems()[0].getValue();;
				oEntry.ShipAccNo 	= targetcntrl[4].getItems()[0].getItems()[1].getItems()[0].getValue();;//targetcntrl[8].getItems()[1].getItems()[0].getValue();;
				
				oEntry.Carrier 		= targetcntrl[4].getItems()[1].getItems()[1].getItems()[0].getSelectedKey();//targetcntrl[9].getItems()[1].getItems()[0].getValue();
				oEntry.DelvDate 	= targetcntrl[4].getItems()[2].getItems()[1].getItems()[0].getValue();//targetcntrl[10].getItems()[1].getItems()[0].getValue();
				oEntry.CustmerPo 	= targetcntrl[4].getItems()[3].getItems()[1].getItems()[0].getValue();//targetcntrl[11].getItems()[1].getItems()[0].getValue();
				oEntry.Note 		= targetcntrl[4].getItems()[4].getItems()[1].getItems()[0].getValue();//targetcntrl[12].getItems()[1].getItems()[0].getValue();
				
				oEntry.Aufnr 		= globalWANo;
				oEntry.Name1 		= shippingCarousel.getPages()[i].getTitle();
				var shipTo = pgID.split('_')[pgID.split('_').length-1];
				if(shipTo != "" && shipTo.length > 10){
					oEntry.ShipTo = shipTo.substring(shipTo.lastIndexOf("-")+1);
				}
				else
				{
					oEntry.ShipTo = shipTo;
				}
				oEntry.UpdFlag		="C";
				oEntry.PrimaryShip	= "";//targetcntrl[13].getItems()[1].getItems()[0].getSelectedKey();
				oEntry.EndPoint = "";
				var primary = targetcntrl[0].getItems()[4].getItems()[1].getItems()[0].getItems()[0].getSelected();
				var endpoint = targetcntrl[0].getItems()[4].getItems()[1].getItems()[0].getItems()[1].getSelected();
				if(primary == true)
				{
					oEntry.PrimaryShip = "X";
				}
				if(endpoint == true)
				{
					oEntry.EndPoint = "X";
				}
				
				if(primary == true && endpoint == true)
				{
					pwc.app.js.CommonUtility.validationMessage("Ship to address cannot be Primary & End-Destination simultaneously","Error Message",sap.m.MessageBox.Icon.ERROR);
					return;
				}
				
				if(oEntry.PrimaryShip == "X"){
					oPrimary = JSON.parse(JSON.stringify(oEntry));
					cnt++;
					if(cnt == 2){
						pwc.app.js.CommonUtility.validationMessage("Ship To should not have more than one primary address type","Error Message",sap.m.MessageBox.Icon.ERROR);
						return;
					}
				 oPrimary.PrimaryShip = "Primary";
				 oPrimary.RegDesc = targetcntrl[2].getItems()[2].getItems()[1].getItems()[0].getValue();
				 oPrimary.CountryName = targetcntrl[2].getItems()[1].getItems()[1].getItems()[0].getValue();
				 if(typeof oPrimary.DelvDate != "undefined" && oPrimary.DelvDate != ""){
					 var s = oEntry.DelvDate.split("-");
					 var dt = s[2]+s[1]+s[0];
					 oPrimary.DelvDate = pwc.app.util.WAFormatter._convDate(dt);	 
				 }
				 
				}
				
				if(oEntry.EndPoint == "X"){
					oEndpoint = JSON.parse(JSON.stringify(oEntry)); 
					endcnt++;
					if(endcnt == 2){
						pwc.app.js.CommonUtility.validationMessage("Shipt To should not have more than one End Point.","Error Message",sap.m.MessageBox.Icon.ERROR);
						return;
					}
					
					
					oEndpoint.EndPoint = "EndPoint";
					oEndpoint.RegDesc = targetcntrl[2].getItems()[2].getItems()[1].getItems()[0].getValue();
					oEndpoint.CountryName = targetcntrl[2].getItems()[1].getItems()[1].getItems()[0].getValue();
					if(typeof oEndpoint.DelvDate != "undefined" && oPrimary.DelvDate != "")
					{
						 var s = oEntry.DelvDate.split("-");
						 var dt = s[2]+s[1]+s[0];
						 oEndpoint.DelvDate = pwc.app.util.WAFormatter._convDate(dt);	 
					}
					
				}
				
				batchChanges.push(oDataModel.createBatchOperation("ZShipment_UpdateSet", "POST", oEntry, null));
			}
			
			
			if(cnt == 0){
				pwc.app.js.CommonUtility.validationMessage("Ship To should have atleast one primary address type","Error Message",sap.m.MessageBox.Icon.ERROR);
				return;
			}
			
			
			if(typeof oPrimary != "undefined"){
				var oModel = new sap.ui.model.json.JSONModel();
				oModel.setData(oPrimary)
				sap.ui.getCore().setModel(oModel,"primaryShipTo");
			}
			
			
			if(endcnt == 1){
				var oModel = new sap.ui.model.json.JSONModel();
				oModel.setData(oEndpoint)
				sap.ui.getCore().setModel(oModel,"endpointShipTo");
			}
			else
			{
				sap.ui.getCore().setModel(null,"endpointShipTo");
			}
			
			

			oDataModel.addBatchChangeOperations(batchChanges);
			oDataModel.setUseBatch(true);
			
			oDataModel.submitBatch(function(data) {	
				//	that.busyDialog.close();
					 if(data.__batchResponses[0].__changeResponses!=null){     
						that._oShippingInfoDialog.close();
						that._oShippingInfoDialog.destroy();
						that._oShippingInfoDialog = false;
						pwc.app.js.CommonUtility.messageToast("Shipping information saved successfully");
						
						that.getView().byId("shippingIcon").setColor("#1cc21c");
						
			        }else{   
			        	pwc.app.js.CommonUtility.messageToast("Error occured while saving shipping information");
			        }
				},function(oError){	
					that.busyDialog.close();
					pwc.app.js.CommonUtility.messageToast("Error occured while saving shipping information");
					
					that._oShippingInfoDialog.close();
					that._oShippingInfoDialog.destroy();
					that._oShippingInfoDialog = false;

				},false,false)
			//	oDataModel.submitBatch();
		},
		

